import React from 'react';
import {
    Title
  } from './WelcomeCard.style';

export default function Page2() {
  return (
    <>  
        <Title>Selamat Datang di Asosiasi Muthowif Indonesia (AMI)</Title>
        <p className="main-info" key="1">Kami adalah Asosiasi Muthowif Indonesia</p>
        <p className="main-info" key="2">Kami adalah Asosiasi Muthowif Indonesia</p>
    </>);
}
